CREATE TABLE moss_type (
    id integer NOT NULL PRIMARY KEY,
    type varchar(200) NOT NULL UNIQUE
);

CREATE SEQUENCE moss_type_seq
    START WITH 6
    INCREMENT BY 1
    NOMAXVALUE;

CREATE OR REPLACE TRIGGER moss_type_id_trigger
  BEFORE INSERT
  ON moss_type
  FOR EACH ROW
  WHEN (new.id is null)
BEGIN
  SELECT moss_type_seq.nextval INTO :new.id FROM DUAL;
END;
/


CREATE TABLE moss (
    id integer NOT NULL PRIMARY KEY,
    sample_id varchar(50) NOT NULL,
    moss_type integer NOT NULL,
    geometry integer NOT NULL,
    lab_no varchar(50) NOT NULL,
    --- mg/kg
    al_conv decimal(20, 10) NOT NULL,
    as_conv decimal(20, 10) NOT NULL,
    cd_conv decimal(20, 10) NOT NULL,
    co_conv decimal(20, 10) NOT NULL,
    cr_conv decimal(20, 10) NOT NULL,
    cu_conv decimal(20, 10) NOT NULL,
    fe_conv decimal(20, 10) NOT NULL,
    mo_conv decimal(20, 10) NOT NULL,
    ni_conv decimal(20, 10) NOT NULL,
    pb_conv decimal(20, 10) NOT NULL,
    s_conv decimal(20, 10) NOT NULL,
    v_conv decimal(20, 10) NOT NULL,
    sb_conv decimal(20, 10) NOT NULL,
    zn_conv decimal(20, 10) NOT NULL,
    hg_conv decimal(20, 10) NOT NULL,
    n_total decimal(20, 10) NOT NULL,

    FOREIGN KEY (moss_type) REFERENCES moss_type,
    FOREIGN KEY (geometry) REFERENCES geom
);


CREATE SEQUENCE moss_seq
    START WITH 1
    INCREMENT BY 1
    NOMAXVALUE;

CREATE OR REPLACE TRIGGER moss_id_trigger
  BEFORE INSERT
  ON moss
  FOR EACH ROW
  WHEN (new.id is null)
BEGIN
  SELECT moss_seq.nextval INTO :new.id FROM DUAL;
END;
/

