CREATE TABLE named_area (
  ID INTEGER PRIMARY KEY NOT NULL,
  name varchar(200) UNIQUE,
  area INTEGER NOT NULL,
  type varchar(50) NOT NULL,

  FOREIGN KEY (area) REFERENCES geom
);

CREATE SEQUENCE named_area_seq
    START WITH 1
    INCREMENT BY 1
    NOMAXVALUE;

CREATE OR REPLACE TRIGGER named_area_id_trigger
  BEFORE INSERT
  ON named_area
  FOR EACH ROW
  WHEN (new.id is null)
BEGIN
  SELECT named_area_seq.nextval INTO :new.id FROM DUAL;
END;
/


